/**
  * @brief  Startup : Shows ST logo and slogan
  * @param  None
  * @retval None
  */
void k_StartUp(void)
{
  uint32_t XPos = 240, XOffset = 3;
  const char ST_Slogan[] = "motor control system";
  const char *p = ST_Slogan;

  GUI_SetBkColor(GUI_WHITE);
  GUI_Clear();
  GUI_DrawBitmap(&bmSTLogo, (LCD_GetXSize() - (bmSTLogo.XSize))/2 , (LCD_GetYSize() - (bmSTLogo.YSize))/2);
  
  GUI_SetFont(&GUI_FontAvantGarde24);
  GUI_SetColor(GUI_STCOLOR_LIGHTBLUE);
  
  do{
    GUI_DispCharAt(*p, XPos , 350);
    XPos += GUI_GetCharDistX(*p++) + XOffset + 1;
    if(*p == 's')
    {
      GUI_SetColor(GUI_STCOLOR_DARKBLUE    );
      XOffset = 0;
    }    
    GUI_Delay(20);
  }while (*p != 0);

  GUI_Delay(1000);     
}
